    const handleOnClick = () =>{
        if(props.DataJudul === "halo"){
            props.ChangeJudul('Halo Dunia')
        }else{
            props.ChangeJudul('halo')
        }
    }

    return(
        <div>
            <h2>{props.DataJudul}</h2>
            <button onClick={handleOnClick}>Ganti h2</button>
        </div>
    )
    
}

